import React, { useEffect, useState } from 'react';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';


function Buy(props){

    const [stocks] = useHttpGet(`http://localhost:5000/api/stocks`, [], 'getting stocks');

    const handleLogout = () => {
        sessionStorage.removeItem("username");
        props.handleLogout();
        props.history.push('/');
    }
    if(!props.username){
        return(<div></div>);
    }else{
        return(
        <div>
            <Navbar user = {props.username} handleLogout = {handleLogout}/>
            <div className="container">
            {stocks.map(stock => (
          <p key = {stock.name}>{stock.name}</p>
        ))}
            </div>
        </div>

    );
    }
    
}

export default Buy;
